import React from "react";

function Card(){
    return (
        <>
        <div className="cards">
            <div className="image">
                <img src="" alt="Cardimage" />
            </div>
        <div className="categroy"><h2>A Netflix Original Series</h2></div>
        <div className="title"><h3>Dark</h3></div>
        <div className="des">
        <button type="button">Watch Now</button></div>
        </div>
        </>
    )
}

export default Card;
